import { createSlice } from "@reduxjs/toolkit";
import { Product } from "../../types/Product";

interface ProductState {
  list: Product[];
}

const initialState: ProductState = {
  list: [
    { id: "bread", name: "Bread", price: 20, image:"/images/bread.jpg" },
    { id: "milk", name: "Milk", price: 34, image:"Images/milk.jpg" },
    { id: "cheese", name: "Cheese", price: 70, image:"Images/chees.jpg" },
    { id: "soup", name: "Soup", price: 125, image:"Images/soup.jpg" },
    { id: "butter", name: "Butter", price: 90, image:"Images/butter.jpg" },
  ]
};

const productsSlice = createSlice({
  name: "products",
  initialState,
  reducers: {}
});

export default productsSlice.reducer;
